import { useEffect } from "react";
import Modal from "./Modal"
import {Button} from "@mantine/core";

function Pending(open,Open,Close)
{   
    useEffect(()=>{})

    if(!open) return null

    return(
        <div>
            <Button className="corner_button" onClick={()=>{Open()}}>+ ADD</Button>
            <div id='portal'> <Modal open={open} isClose={Close}></Modal></div>
                
            <table border={3} style={{marginTop:"70px",maxwidth:"1000px"}}>
                <tr>
                    <td> Hello </td>
                </tr>   
                </table>
        </div>
    )
}

export default Pending;
